import React from "react";
import { Container, Row, Col, Nav, Card, Button } from "react-bootstrap";
import siyaImage from "../../Resources/Images/siya.jpg";
const Project = ({ project }) => {
	const icons = project.icons.map(icon => {
		const iconPath = "../../Resources/Icons/" + icon;
		return (
			<Nav.Link
				className="tech"
				href="#"
				style={{ backgroundImage: iconPath}}
			></Nav.Link>
		);
	});

	return (
		<Container fluid className="mt-5">
			<Card style={{ width: "18rem" }}>
				<Card.Img variant="top" src={siyaImage} />
				<Card.Body>
					<Card.Title>{project.name}</Card.Title>
					<Card.Text>{project.description}</Card.Text>
					<Button id="btnGit" className="btn"></Button>
				</Card.Body>
				<Card.Footer>
					<Row>
						<Nav>
							<icons />
						</Nav>
					</Row>
				</Card.Footer>
			</Card>
		</Container>
	);
};

export default Project;
